import React from "react";
import styles from "./Player.module.css";

const Player = () => {
  return (
    <div className={styles.player}>
      <div className={styles.playerLeft}>
        <img src={require("../../Assets/Icons/player_Icon.png")} alt="" />
      </div>
    </div>
  );
};

export default Player;
